import React from "react";
import Navbar from "./components/Navbar";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Footer from "./components/Footer";
import Signup from "./components/Signup";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<h1>Product Home Page</h1>} />
          <Route path="/add" element={<h1>Product Add Page</h1>} />
          <Route path="/update" element={<h1>Product Update Page</h1>} />
          <Route path="/profile" element={<h1>Product Profile Page</h1>} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/logout" element={<h1>Product Logout Page</h1>} />
        </Routes>
      </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
